def isNested(s: str) -> bool:
    """"""
    bracket_stack = []
    for char in s:
        if char == '[':
            bracket_stack.append(char)
        elif char == ']':
            if not bracket_stack:
                return False
            bracket_stack.pop()
    return bracket_stack == [] and '[' + ']' in s
